import './App.css';
import UploadForm from './FileUpload';
import Home from "./Home";
import Navigator from './NavigationBar';
import {BrowserRouter as Router, Route, Routes} from 'react-router-dom';

function App() {
  return (
    <Router>
    <div className="App">
        <Navigator />
        <div className='content'>
          <Routes>
        <Route exact path="/">
          <UploadForm />
        </Route>
        <Home />
        </Routes>
      </div>
    </div>
    </Router>
  );
}

export default App;
